import React from 'react';
import "./style.css"
import { Container, Row, Col } from 'react-bootstrap';
import Skill from "../components/Skills/Skills";

export default function Skills() {

    return (
        <div className="skills-section">
            <Container>
                <Row>
                    <Col>
                        <h1>Skills</h1>
                    </Col>
                    <Col md={12}>
                        <div class="skills-container">
                            <Skill/>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}
